The following three types of model files can be placed in the opened directory or its subfolders:

§2§nfolder:§r The folder should contain Bedrock Edition model files and textures;

§2§nzip file:§r The compressed package should directly contain Bedrock Edition model files and textures;

§2§nysm file:§r This format is an encrypted file and cannot be edited or modified.
